import React from "react";

const LandingPage = () => {
  // Inline styles
  const styles = {
    landingPage: {
      textAlign: "center",
      padding: "20px",
      backgroundColor: "#f8f9fa",
      color: "#333",
    },
    header: {
      marginBottom: "20px",
    },
    logo: {
      width: "100px",
      height: "auto",
      marginBottom: "10px",
    },
    brandName: {
      fontSize: "2rem",
      color: "#333",
    },
    description: {
      margin: "20px 0",
      fontSize: "1.2rem",
    },
    offer: {
      backgroundColor: "#fce4ec",
      border: "2px solid #f06292",
      padding: "20px",
      borderRadius: "8px",
      margin: "20px auto",
      width: "80%",
    },
    ctaButton: {
      backgroundColor: "#f06292",
      color: "white",
      padding: "10px 20px",
      border: "none",
      borderRadius: "4px",
      fontSize: "1rem",
      cursor: "pointer",
    },
    ctaButtonHover: {
      backgroundColor: "#d81b60",
    },
  };

  return (
    <div style={styles.landingPage}>
      {/* Logo Section */}
      <header style={styles.header}>
        <img
          src="logo.png" // Replace with your logo file path
          alt="Brand Logo"
          style={styles.logo}
        />
        <h1 style={styles.brandName}>Brand Name</h1>
      </header>

      {/* Description Section */}
      <section style={styles.description}>
        <p>
          Welcome to <strong>Brand Name</strong>, your ultimate destination for
          [Your Service/Product].
        </p>
      </section>

      {/* Offer Section */}
      <section style={styles.offer}>
        <h2>Special Offer!</h2>
        <p>
          Get 20% off on your first purchase. Use code: <strong>WELCOME20</strong>
        </p>
        <button
          style={styles.ctaButton}
          onMouseOver={(e) => (e.target.style.backgroundColor = styles.ctaButtonHover.backgroundColor)}
          onMouseOut={(e) => (e.target.style.backgroundColor = styles.ctaButton.backgroundColor)}
        >
          Claim Offer
        </button>
      </section>
    </div>
  );
};

export default LandingPage;
